    JomsEmoji.prototype.toCodePoint =   function (unicodeSurrogates, sep) {
        var
          r = [],
          c = 0,
          p = 0,
          i = 0;
        while (i < unicodeSurrogates.length) {
          c = unicodeSurrogates.charCodeAt(i++);
          if (p) {
            r.push((0x10000 + ((p - 0xD800) << 10) + (c - 0xDC00)).toString(16));
            p = 0;
          } else if (0xD800 <= c && c <= 0xDBFF) {
            p = c;
          } else {
            r.push(c.toString(16));
          }
        }
        return r.join(sep || '-');
      }

      JomsEmoji.prototype.stringFromCodePoint = function () {
        var MAX_SIZE = 0x4000
        var codeUnits = []
        var highSurrogate
        var lowSurrogate
        var index = -1
        var length = arguments.length
        if (!length) {
          return ''
        }
        var result = ''
        while (++index < length) {
          var codePoint = Number(arguments[index])
          if (
            !isFinite(codePoint) || // `NaN`, `+Infinity`, or `-Infinity`
            codePoint < 0 || // not a valid Unicode code point
            codePoint > 0x10ffff || // not a valid Unicode code point
            Math.floor(codePoint) != codePoint // not an integer
          ) {
            throw RangeError('Invalid code point: ' + codePoint)
          }
          if (codePoint <= 0xffff) {
            // BMP code point
            codeUnits.push(codePoint)
          } else {
            // Astral code point; split in surrogate halves
            // http://mathiasbynens.be/notes/javascript-encoding#surrogate-formulae
            codePoint -= 0x10000
            highSurrogate = (codePoint >> 10) + 0xd800
            lowSurrogate = codePoint % 0x400 + 0xdc00
            codeUnits.push(highSurrogate, lowSurrogate)
          }
          if (index + 1 === length || codeUnits.length > MAX_SIZE) {
            result += String.fromCharCode.apply(null, codeUnits)
            codeUnits.length = 0
          }
        }
        return result
      }
    

    JomsEmoji.prototype.getIcon = function(code){
        code = code.substring(1,code.length-1);
        let emojiId = code; 
        let emojicode = "";
        if (emoji_json.emojis[emojiId]["b"].includes("-")) {
            let res ;
            if(typeof emoji_json.emojis[emojiId]["c"] !== "undefined"){
                 res = emoji_json.emojis[emojiId]["c"].split("-");
            }else{
                res = emoji_json.emojis[emojiId]["b"].split("-");
            }
           
            _.each(res, function (c) {

                emojicode += "&#x" + c + ";";

            })


        } else {
            emojicode = "&#x" + emoji_json.emojis[emojiId]["b"] + ";"
        }
        return '<i contenteditable="false" shortCode="'+emojiId+'" class="joms-content1-emo2 joms-emo2 joms-emo2-'+emojiId+'">'+emojicode +'</i>'
       

      
    }

    JomsEmoji.prototype.getIconByUni = function(unicode){

        let codepoint = this.toCodePoint(unicode).toUpperCase();
        let codes =emoji_json.emojis ;
        let found = false ;
        
        $.each(codes,function(idx,code){
             if(code["b"]== codepoint){
                found = idx ;
                return false;
             }
             if(code["c"]== codepoint){
                found = idx ;
                return false;
             }
        });
        if(found !== false){
           return this.getIcon(":"+found+":");
        }
       
       return false;
    }

    JomsEmoji.prototype.getCodeByUni = function(unicode){

        let codepoint = this.toCodePoint(unicode).toUpperCase();
        let codes =emoji_json.emojis ;
        let found = false ;
        
        $.each(codes,function(idx,code){
             if(code["b"]== codepoint){
                found = idx ;
                return false;
             }
             if(code["c"]== codepoint){
                found = idx ;
                return false;
             }
        });
        if(found !== false){
           return ":"+found+":";
        }
       
       return false;
    }

    JomsEmoji.prototype.replaceEmojiElementsToText = function( element ) {

        let icons = element.find("i");

        if(icons.length){

            _.each(icons,function(icon){
                let code = $(icon).attr('shortCode');
                icon.replaceWith(":"+code+":");

            });

        }

       
        return element ;
        

    },
    
    JomsEmoji.prototype.getEmoticon = function( str ) {
        var emoticons = joms.getData('joms_emo'),
            codes = [],
            names = [];

        _.each( emoticons, function(emo, name) {
            codes.unshift(emo);
            names.unshift(name);
        }) 

        _.each( codes, function( code, idx ) {
            _.each( code, function(c) {
                let code = "";
                let emojiId =  names[idx] ;
                if (emoji_json.emojis[emojiId]["b"].includes("-")) {

                    
                    let res = "";
                    if(typeof emoji_json.emojis[emojiId]["c"] !== "undefined"){
                        res = emoji_json.emojis[emojiId]["c"].split("-");
                   }else{
                       res = emoji_json.emojis[emojiId]["b"].split("-");
                   }
                    _.each(res, function (c) {

                        code += "&#x" + c + ";";

                    })


                } else {
                    code = "&#x" + emoji_json.emojis[emojiId]["b"] + ";"
                }
                str = str.replace(c, '<i contenteditable="false" class="joms-content1-emo2 joms-emo2 joms-emo2-'+names[idx]+'">'+code +'</i><br>'  );
            });
        });

        return str;
    }
	
